import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
width:360px;
margin-bottom:45px;
cursor:pointer;
`;
const Image = styled.img`
width:100%;
height:202px;
background-color:#999;
`;
const Details = styled.div`
display:flex;
margin-top:16px;
gap:12px;
`;
const ChannelImage = styled.img`
width:36px;
height:36px;
border-radius:50%;
background-color:#999;
`;

export default function Card() {
  return (
    <Container>
      <Image src="https://assets-prd.ignimgs.com/2022/02/08/toppokemongamesofalltime-blogroll-1644358512665.jpg"/>
        <Details>
            <ChannelImage />
        </Details>

    </Container>
  )
}
